import React from "react";
import './listaContato.css'
// import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
// import 'bootstrap/dist/js/bootstrap.bundle'



export default function Listas (props) {
    return (
        <div className="container  justify-content-center">
            <div className= "agenda row">
                <p className="col-6"> {props.nome} - {props.telefone} </p> 
                <button className="remover col-6" onClick={() => {props.remover({nome: props.nome, contato: props.telefone })}} >Remover</button>
             </div>
        </div>
        
    )
}
